import React, { Component } from 'react'

class UserGreeting extends Component {
    constructor(props) {
      super(props)

      this.state = {
        isLoggedIn:true
      }
    }

  render() {
    if (this.state.isLoggedIn){
        return(
            <div>
                welcome Mr.Sabari
            </div>
        )
    }
    else{
        return(
            <div>welcome Guest</div>
        )
    }

    return (
      <div>
        <div>welcome Mr.Sabari</div>
        <div>welcome Guest</div>
      </div>
    )
  }
}

export default UserGreeting
